css:
.github-StubItem-git,
.github-Git-root {
  flex: 1;
  display: flex;
}
.github-Git {
  flex: 1;
  display: flex;
  flex-direction: column;
  min-width: 0;
  font-family: system-ui;
  font-size: 12px;
  color: #424243;
  -webkit-user-select: none;
  cursor: default;
}
.github-Git.no-repository {
  padding: 30px;
  text-align: center;
}
.github-Git.is-loading {
  color: #8e8e90;
}
.github-Git.no-repository {
  display: flex;
  justify-content: center;
  font-size: 1.25em;
}
.github-Git.no-repository > * {
  margin: 10px 0;
}
.github-Git.no-repository .git-logo-path {
  fill: #bbbbbc;
}
.github-Git.no-repository .btn.btn-primary {
  overflow: hidden;
  text-overflow: ellipsis;
}
atom-dock.bottom .github-Git {
  flex-direction: row;
}
atom-dock.bottom .github-StagingView {
  display: contents;
}
atom-dock.bottom .github-Git > div {
  flex: 1;
}
atom-dock.bottom .github-StagedChanges {
  border-left: 1px solid #dbdbdc;
  border-right: 1px solid #dbdbdc;
}
atom-dock.bottom .github-StagingView-header {
  flex-wrap: wrap;
}
atom-dock.bottom .github-StagingView-group:first-child .github-StagingView-header {
  border-top: 1px solid #dbdbdc;
}
atom-dock.bottom .github-RecentCommits {
  max-height: none;
  border-left: 1px solid #dbdbdc;
}
